import React from "react";
import {
  AiOutlineLinkedin,
  AiOutlineInstagram,
  AiFillGithub,
} from "react-icons/ai";

const Footer = () => {
  return (
    <div className="footer">
      <div className="author">
        <p>This Portfolio is designed by Nikhil Ramesh</p>
      </div>
      <div className="author-links">
        <p>Get In Touch</p>
        <div className="links">
          <a href="https://linkedin.com/in/prakruthi-manjunath" target="blank">
            <AiOutlineLinkedin />
          </a>
          <a href="https://www.instagram.com/prakruthi_21/" target="blank">
            <AiOutlineInstagram />
          </a>
          <a href="#">
            <AiFillGithub />
          </a>
        </div>
      </div>
    </div>
  );
};

export default Footer;
